    "parker-river-national-wildlife-refuge-annual-narrative-report-calendar-year-1987",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Parker
    River NWR (including satellite refuges) outlines Refuge accomplishments during the
    1987 calendar year. The report begins with a summary of the year's highlights and
    weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses compliance with environmental and cultural resource mandates
    and research and investigations. Refuge administration is outlined; information
    about personnel, youth programs, volunteer programs, funding, safety, and technical
    assistance is given. Habitat management is also covered; subjects include wetlands,
    grasslands, haying, fire management, pest control, and wilderness areas. The wildlife
    section of the report discusses wildlife diversity, endangered and threatened species,
    waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals, and marking
    and bird banding. The public uses of the Refuge described in this report include
    outdoor classrooms, interpretive programs, hunting, fishing, wildlife observation,
    outdoor recreation, and law enforcement. The equipment and facilities section of
    the report provides information about major maintenance and equipment replacement.
    Cooperative programs, Refuge brochures and items of interest are provided at the
    end.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
